$(document).ready(function(){$.getJSON("json/insure.json",function(e){$.each(e,function(){if("content"in document.createElement("template"))for(var t=document.querySelector("#js-insurance__row"),n=t.content.querySelector(".company__name"),o=t.content.querySelector(".table__covering"),r=t.content.querySelector(".js-type"),c=t.content.querySelector(".js-level"),l=t.content.querySelector(".table__drugs"),a=t.content.querySelector(".table__visits"),i=t.content.querySelector(".table__deductible"),u=t.content.querySelector(".js-price"),s=e.cart,_=document.querySelector(".main__table"),d=0;d<s.length;d++){n.textContent=s[d].name,o.textContent=s[d].covering,r.textContent=s[d].type,c.textContent=s[d].level,l.textContent=s[d].drugs,a.textContent=s[d].visits,i.textContent=s[d].deductible,u.textContent=s[d].price;var y=document.importNode(t.content,!0);_.appendChild(y)}for(var m=$(".company__logo"),v=$(".table__level--color"),g=$(".company__rating").children(".star"),d=0;d<s.length;d++){m[d].setAttribute("src",s[d].logo),v[d].setAttribute("data-color",s[d].level.toLowerCase());for(var b=0;b<5;b++)if(b<s[d].rating){var p=5*d+b;g[p].setAttribute("data-color","gold")}}})})});